import React from 'react'
import './App.css'
import { Switch,Route } from 'react-router-dom';
import Homepage from './pages/Homepage';


const Home = (props) =>{
  console.log(props)
 return (<div>
    <h1>Home here</h1>
  </div>)
}

const TopicList = ()=>{
return (<div>
   <h1>Topiclist here</h1>
 </div>)
}

const TopicDetail = () =>{
return (<div>
   <h1>Home here</h1>
 </div>)
}

function App () {
  return(
    <div>
      <Switch>
        <Route path="/" component={Home} />
        <Route exact path="/topics" component={TopicList} />
        <Route path="/topics/:topicId" component={TopicDetail} />
      </Switch>
    </div>
  )
}


export default App;
